import React from 'react'
import AppRouter from '../Router/AppRouters.js';
import '../Styles/NavBar.css'
import { Link } from 'react-router-dom'

function NavBar(props) {

    // Project Function
    function handleProject() {        
        // window.scrollBy(0, 987);
        window.scroll({
            top:987,
            behavior: "smooth"
        })
        console.log('You clicked submit.');
    }

    // const navColorChange = ((props.navColor ==="#777777") ? "red":"blue").toString();
    // console.log(navColorChange)

    // const newColor = navColorChange.toString()
    // console.log("this now",newColor)
    console.log(props.styleBar)
    // const newThis = props.navColor.toString()

    return (
        <div>
            {/* <AppRouter/> */}
            {/* <div className="main-container" style={{color:{navColor}}}> */}
            <div className="main-container">

                <div className="flex-child">
                    <div className="box-this" style={props.styleBar}></div>
                    {/* <p className="text-this">Home</p> */}
                    <button className="nav-button">
                        <Link to="/home">
                            <p className="text-this" style={props.style}>Home</p>
                        </Link>
                    </button>
                </div>
                <div className="flex-child">
                    <div className="box-this" style={props.styleBar}></div>
                    <button className="nav-button" onClick={handleProject}>
                        {/* <a href='http://localhost:3000/Projects'> */}
                            <p className="text-this" style={props.style}>Projects</p>
                        {/* </a> */}
                    </button>
                    {/* <p className="text-this">Projects</p> */}
                </div>
                <div className="flex-child">
                    <div className="box-this" style={props.styleBar}></div>
                    {/* <p className="text-this">About</p> */}
                    {/* <button className="nav-button"> */}
                        <a href="http://localhost:3000/About">
                            <p className="text-this" style={props.style}>About</p>
                        </a>
                        {/* <Link to="/About">
                            <p className="text-this" style={props.style}>About</p>
                        </Link> */}
                    {/* </button> */}
                </div>
                <div className="flex-child">
                    <div className="box-this" style={props.styleBar}></div>
                    {/* <p className="text-this">Photography</p> */}
                    <button className="nav-button">
                        <p className="text-this" style={props.style}>Gallery</p>
                    </button>
                </div>
                <div className="flex-child">
                    <div className="box-this" style={props.styleBar}></div>
                    <a className="button-resume" href={require('../Documents/JonathanDominguez.pdf')} download="JonathanDominguez">
                        {/* <p className="text-this">Resume</p> */}
                        <button className="nav-button">
                            <p className="text-this" style={props.style}>Resume</p>
                        </button>
                    </a>
                </div>
            </div>

{/* Tests */}
            {/* <div class="container">
                <div class="item">
                    <div class="box-this"></div>
                    <p class="text-this">Item</p>
                </div>


    <div class="item">Item with more text in it.</div>
    <div class="item">
    Item with more text in it, hopefully we have added enough text so the text
    will start to wrap.
    </div>
</div>
Copy to Clipboard */}


            {/* <ul>
                <li>
                    <div class="barStyle"></div>
                    <a href="#home">Home</a></li>
                <li><a href="#projects">Projects</a></li>
                <li><a href="#about">About</a></li>
                <li><a href="#blog">Blog</a></li>
                <li><a href="#resume">Resume</a></li>
            </ul> */}

        </div>
    )
}

export default NavBar
